import React, { useState } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useHistory,
} from 'react-router-dom';
import './App.css';
import Board from './views/Board';
import Home from './views/Home';

function App() {
    return (
        <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/board" component={Board} />
        </Switch>
    );
}

export default App;
